Types of Disciplinary Action and/or Sanction
Which disciplinary action or sanction is most appropriate will depend on:
• the seriousness of the offence;
• your explanation for your actions; and/or
• whether there has been a repetition of the same or similar offence.
The Company may consider imposing any one or more of the following sanctions:
• counseling;
• written warning;
• demotion;
• period of suspension with or without pay;
• reduction in pay;
• prohibition on being considered for a pay review and/or a promotion;
• loss of future pay increment or bonus; or
• termination of employment.
